import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

const PlannerTableRow = (props) => {

    const tableRows = Object.keys(props.spending).map((catKey) => {
        return (<Link
            key={props.spending[catKey].name}
            className="block px-8 py-4" to={`/budget/${props.spending[catKey].name}`}>
            <div
                className="text-sm leading-5 text-gray-900 font-semibold">
                {props.spending[catKey].spending}
            </div>
        </Link>)
    });

    return (
        < tr className="hover:bg-gray-100 transition-all ease-linear duration-200 cursor-pointer" >

            <td className="w-1/2 whitespace-no-wrap border-b border-gray-200">
                {tableRows}
            </td>

            <td className="w-1/2 whitespace-no-wrap border-b border-gray-200">
                {tableRows}
            </td>
        </tr >
    );
}

PlannerTableRow.propTypes = {
    project: PropTypes.object,
};

export default PlannerTableRow;
